/*==== Toggle Sidebar Btn ====*/
.menu-btn {
  margin-right: 20px;
  -webkit-transition: all 0.7s;
  transition: all 0.7s;
  font-size: 1.2em;
}

.menu-btn span {
  display: block;
  width: 20px;
  height: 2px;
  margin: 4px auto 0;
  -webkit-transition: all 0.3s cubic-bezier(0.81, -0.33, 0.345, 1.375);
  transition: all 0.3s cubic-bezier(0.81, -0.33, 0.345, 1.375);
  background: #fff;
}

.menu-btn span:nth-of-type(2) {
  position: relative;
  width: 35px;
  -webkit-transform: rotateY(180deg);
  transform: rotateY(180deg);
}

.menu-btn span:nth-of-type(2)::before, .menu-btn span:nth-of-type(2)::after {
  display: block;
  width: 6px;
  height: 2px;
  content: '';
  -webkit-transition: all 0.7s;
  transition: all 0.7s;
  -webkit-transform: rotate(45deg);
  transform: rotate(45deg);
  background: #fff;
  position: absolute;
  top: 2px;
  left: 0;
}

.menu-btn span:nth-of-type(2)::after {
  -webkit-transform: rotate(145deg);
  transform: rotate(145deg);
  position: absolute;
  top: -2px;
  left: 0;
}

.menu-btn.active span:first-of-type {
  -webkit-transform: translateY(12px);
  transform: translateY(12px);
}

.menu-btn.active span:nth-of-type(2) {
  -webkit-transform: none;
  transform: none;
}

.menu-btn.active span:last-of-type {
  -webkit-transform: translateY(-12px);
  transform: translateY(-12px);
}

